window.bookSummaryJSON = "<p>Writing computer programs in Python just got a lot easier! Use AI-assisted coding tools like GitHub Copilot and ChatGPT to turn your ideas into applications faster than ever.</p> <p>In Learn AI-Assisted Python Programming: With GitHub Copilot and ChatGPT you’ll learn how to:</p> <p>- Write fun and useful Python applications—no programming experience required!</p> <p>- Use the Copilot AI coding assistant to create Python programs</p> <p>- Write prompts that tell Copilot exactly what to do</p> <p>- Read Python code and understand what it does</p> <p>- Test your programs to make sure they work the way you want them to</p> <p>- Fix code with prompt engineering or human tweaks</p> <p>- Apply Python creatively to help out on the job</p> <p>AI has changed the way we write computer programs. With tools like Copilot and ChatGPT, you can describe what you want in plain English, and watch your AI assistant generate the code right before your eyes. It’s perfect for beginners, or anyone who’s struggled with the steep learning curve of traditional programming.</p> <p>About the technology</p> <p>The way people write computer programs has changed forever. Using GitHub Copilot, you describe in plain English what you want your program to do, and the AI generates it instantly.</p> <p>About the book</p> <p>This book shows you how to create and improve Python programs using AI—even if you’ve never written a line of computer code before. Spend less time on the slow, low-level programming details and instead learn how an AI assistant can bring your ideas to life immediately. As you go, you’ll even learn enough of the Python language to understand and improve what your AI assistant creates.</p> <p>About the listener</p> <p>If you can move files around on your computer and install new programs, you can learn to write useful software!</p> <p>About the author</p> <p>Dr. Leo Porter is a Teaching Professor at UC San Diego. Dr. Daniel Zingaro is an Associate Teaching Professor at the University of Toronto. The technical editor on this book was Peter Morgan.</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
